def my_address(city: str, state: str, country: str = "India") -> None:
    """Print address."""
    print("I live in", city, ",", state, ",", country)


my_address("Mumbai", "Maharashtra")


def try_function(*args: str, **kwargs: str) -> None:
    """Print week days."""
    print("args:", args)
    print("kwargs:", kwargs)


try_function(
    "Monday",
    "Tuesday",
    "Wednesday",
    fourth="Thursday",
    fifth="Friday",
    weekendl="Saturday",
    weekend2="Sunday",
)


