def leap_year_to_check(year: int) -> str:
    """Check if a year is a leap year."""
    if year % 4 == 0:
        if year % 100 == 0:
            if year % 400 == 0:
                return "Leap year"
            return "Not leap year"
        return "Leap year"
    return "Not leap year"


# Пример использования

print(leap_year_to_check(2000))  # Вывод: Leap year
print(leap_year_to_check(1900))  # Вывод: Not leap year
print(leap_year_to_check(2020))  # Вывод: Leap year
print(leap_year_to_check(2021))  # Вывод: Not leap year


