# +
def factorial(num: int) -> int:
    """Вычисляет факториал числа.

    Аргументы:
        num (int): Число, для которого нужно вычислить факториал.

    Возвращает:
        int: Факториал числа.
    """
    fact = 1

    for i_ in range(2, num + 1):
        fact *= i_

    return fact


