# 7. Напишите функцию, которая принимает в качестве входных данных список и<br>
# возвращает его перевернутый вариант.

def reversed_list(lst: list[int]) -> list[int]:
    """Переворачивает список.

    Аргументы:
        lst (list): Список для переворота.

    Возвращает:
        list: Перевернутый список.
    """
    lst_rev = []
    for i_ in range(len(lst) - 1, -1, -1):
        lst_rev.append(lst[i_])
    return lst_rev


