def number_sum(num: int) -> int:
    """Суммирует цифры числа.

    Аргументы:
        num (int): Число для суммирования цифр.

    Возвращает:
        int: Сумма цифр числа.
    """
    total = sum(int(i_) for i_ in str(num))
