# 10. Напишите функцию, которая проверяет, является ли переданное число простым<br>
# Ввод числа

numb: int = int(input("Введите число: "))

# Шаг 1: Проверка на четность

if numb < 2:
    print(f"{numb} => не простое")
elif numb % 2 == 0:
    print(f"{numb} => сложное")
else:
    # Шаг 3: Проверка делимости на нечетные числа от 3 до numb
    is_prime = True
    for i in range(3, numb, 2):
        if numb % i == 0:
            print(f"{numb} => не простое")
            is_prime = False
            break

    # Шаг 4: Вывод результата
    if is_prime:
        print(f"{numb} => простое")

#
# 1. **Ввод числа**: Пользователь вводит число, которое будет проверяться на простоту.<br>
# <br>
# 2. **Проверка на четность**:<br>
#    - Если число меньше 2, оно не является простым.<br>
#    - Если остаток от деления числа на 2 равен 0, то число четное и, следовательно, сложное (за исключением числа 2, которое является простым).<br>
# <br>
# 3. **Цикл по нечетным числам**:<br>
#    - Мы пробегаемся по всем нечетным числам от 3 до num с шагом 2.<br>
#    - Если число делится на любое из этих чисел без остатка, оно не является простым.<br>
# <br>
# 4. **Вывод результата**:<br>
#    - Если ни одно из условий не выполнено, значит число простое.<br>
